import React from 'react';
import { Link } from 'react-router-dom';

function Login() {
  return (
    <div className="flex flex-col items-center mt-10">
      <h2 className="mb-4">로그인</h2>
      <form>
        <label htmlFor="username" className="mb-2">사용자명:</label>
        <input type="text" id="username" name="username" className="px-4 py-2 mb-4 border border-gray-300 rounded-md" />

        <label htmlFor="password" className="mb-2">비밀번호:</label>
        <input type="password" id="password" name="password" className="px-4 py-2 mb-4 border border-gray-300 rounded-md" />

        <button type="submit" className="px-4 py-2 bg-blue-500 text-white rounded-md">로그인</button>
      </form>

      <p className="mt-4">계정이 없으신가요? <Link to="/sign-up" className="text-blue-500">회원가입</Link></p>
    </div>
  );
}

export default Login;
